import Footer from "./components/Footer";
import Header from "./components/Header";
import Hero from "./components/Hero";
import Navigaton from "./components/Navigation";

import "./styles/reset.scss";
import "./styles/style.scss";

const App = () => {
    return (
        <div className="App">
            <Header />
            <Hero />
            <Navigaton />

            <Footer />
        </div>
    );
};

export default App;
